                            "label": "about",
                            "content": "\n\t\t\t<p>&nbsp;&nbsp;&nbsp;&nbsp;Gray Reinhard is a Jersey born keyboardist, guitarist, accordionist, vocalist, composer and studio engineer. In the past few years, Gray\u2019s performed in 22 countries across 4 continents. Some notable musical highlights included a performance with Bruce Springsteen at the Asbury Park Light of Day festival, a performances as a featured pianist with the Minnesota Orchestra, guest conducted by Doc Severinsen, international tours with New York legend Garland Jeffreys, associate music director and pit multi-instrumentalist for NYC Shakespeare in the Park Serie\u2019s new musical Love\u2019s Labour\u2019s Lost (directed by Alex Timbers and music by Michael Friedman), a six week Central/South American tour on behalf of the US State Department\u2019s American Music Abroad Program, and the release of Gray\u2019s roots rock band\u2019s debut album \u201CCurtis & Reinhard Live at the Pigeon Club.\u201D He also had the distinction of being one of a handful of Americans permitted to teach and perform in Turkmenistan on behalf of the State Department.</p>\n\t\t\t<p>&nbsp;&nbsp;&nbsp;&nbsp;In addition to touring Gray composes and produces music for TV and film as a co-founder of, <a href=\u201Chttp://www.hearsayproductions.com/\u201D target=\u201C_blank\u201D>Hearsay Productions</a>. Credits include: ABC\u2019s \u201COne Life To Live,\u201D NBC\u2019s \u201CThe Voice,\u201D Fox\u2019s \u201CSo You Think You Can Dance,\u201D and an MTV appearance with Alicia Keys and Nick Lachey.</p>\n\t\t\t<p>&nbsp;&nbsp;&nbsp;&nbsp;In Gray\u2019s spare time he is working on a solo album, putting on the final touches for the upcoming <a href=\u201Chttps://www.facebook.com/CurtisReinhard\u201D target=\u201C_blank\u201D>Curtis & Reinhard</a> album, and renovating his 1972 Hammond B3 organ/leslie combo.</p>\n"
